import React from 'react';
import Navbar from '../../components/navbar/Navbar';
import PriceTier from '../../components/priceTier/PriceTier';
import './pricing.css';

const pricingData = [
  {
    name: "The Career Builder",
    price: "59",
    searches: "120",
    extension: true,
    second: true,
    bulk: true,
    templates: true,
    reply: true,
  },
  {
    name: "The Job Seeker",
    price: "29",
    searches: "30",
    extension: true,
    second: false,
    bulk: false,
    templates: true,
    reply: false,
  },
  {
    name: "The Networker",
    price: "0",
    searches: "3",
    extension: true,
    second: false,
    bulk: false,
    templates: true,
    reply: false,
  },
]

const Pricing = () => {
  return (
    <div>
      <Navbar/>
      <div className='pricing'>
        <h1>
          Land Your
          <font className='color__change'> Dream Job </font>
        </h1>
        <div className='pricing__tiers'>
          {pricingData.map((item, index) => (
              <PriceTier name={item.name} price={item.price} key={index}/>
              ))}
        </div>
      </div>
    </div>
  )
}

export default Pricing
